import { ActionTypes } from "@mui/base"

const initialState = {
    movies:[
        {
        id:1,
        title:'first',
        category:'RO',

        }
    ],
}

export const movieReducer = (state=initialState, {type,payload})=> {
    switch(type){
        case ActionTypes.SET_MOVIES:
            return state;

        default:
            return state;   
    }
}
